import React from 'react';
export default class Nav extends React.Component {
    render() {
        return (
            <nav>
            <button>Discover</button>
            <button>Create</button>
            <button>My Calendar</button>
            <button><img src= {process.env.PUBLIC_URL + '/user_white.png'} alt = "profile"/></button>
            <button><img src= {process.env.PUBLIC_URL + '/settings_White.png'} alt = "profile"/></button>

            </nav>



        )
    }
}
